def prime_factors(integers):
    def is_prime(n):
        if n < 2:
            return False
        for i in range(2, int(n**0.5) + 1):
            if n % i == 0:
                return False
        return True

    n = integers[90]
    factors = set()

    for i in range(2, n+1):
        if is_prime(i) and n % i == 0:
            factors.add(i)

    return factors
```
Note: The code assumes that the list of positive integers passed to the `prime_factors` function is non-empty.
